(5, -1, 'Club Shop', 1, 9, '1', '1', 1, '0', 3, 'default_3x3', 'catalog_club_headline1', 'catalog_hc_teaser', '', '', '', 0, '', '', '0', '', ''),
(7, 5, 'Buy Club', 1, 9, '0', '0', 1, '0', 1, 'default_3x3', 'habboclub_2', 'catalog_hc_teaser', '', 'Habbo Club, purHabbo one of the three options', '', 0, '', '', '0', '', ''),
(8, 5, 'Buy Club Furni', 1, 9, '1', '1', 1, '0', 2, 'default_3x3', 'catalog_header_hc', 'catalog_hc_teaser', '', 'We\'ve got all that exclusive club furniture available for you right here .. but for an exclusive price.', '', 0, '', '', '0', '', ''),
(9, -1, 'E-Chance', 8, 123, '0', '0', 1, '0', 170, 'default_3x3', '', '', '', '', '', 0, '', '', '0', '', ''),
(10, 9, 'E-Chance', 1, 7, '0', '0', 1, '0', 1, 'recycler', 'E-Chance1', 'ctlg_ecotron_image', '', 'Become an Eco-warrior', 'Use you credits and be rewarded with a random prize. Check out the prizes and the instructions for E-Chance.', 0, 'Drag 5 tokens to the boxes below and click recycle!', '', '0', '', ''),
(11, 9, 'Rewards', 1, 26, '0', '0', 1, '0', 3, 'recycler_prizes', 'E-Chance1', '', '', 'What are the prizes? E-Chance box may contain one of these:', '', 0, '', '', '0', '', ''),
(12, 9, 'Instructions', 1, 42, '0', '0', 1, '0', 4, 'recycler_info', 'E-Chance1', 'ctlg_ecotron_box', '', 'This is a new E-Chance. Get using credits again... what will you get in return? It\'s a surprise! Become a Habbo eco-warrior. No refunds!\r\n', 'How to use the C-Chance?', 0, '1. Just drag 5 tokens from your hand to the E-Chance. One item / square. E-Chance items are marked in your inventory with an image. When you have 5 tokens in the boxes, click the "Recycle" button. You can now find the E-Chance prize box from your hand.\r\n\r\n2. Click the box to see its tag. Open the box, or trade it unopened. Check out what prizes can be won on the rewards page.', '', '0', '', ''),
(13, 9041, 'Exchange', 1, 1, '1', '1', 1, '0', 1, 'default_3x3', 'catalog_bank_headline1', 'catalog_bank_teaser', 'catalog_special_txtbg1', 'You can exchange your Habbo credits here for Exchange furniture, which you can use in a trade or simply exchange for actual credits.', '', 0, 'Click on an item to see more details.', 'Gold! Glorious Gold!', '0', '', ''),
(14, -1, 'Pets Shop', 5, 8, '1', '0', 1, '0', 164, 'default_3x3', 'bubbo_catalogue', '', '', '', '', 0, '', '', '0', '', ''),
(15, 3, 'Spaces', 1, 55, '1', '1', 1, '0', 59, 'spaces_new', 'catalog_spaces_headline1', '', '', 'Floors, wallpapers and landscapes - get a groovy combination for your room! Use our sample room below to try before you buy! Select your favourite designs and colours and simply click Buy!', '', 0, '', '', '0', '', ''),
(16, -1, 'VIP Shop', 11, 137, '1', '1', 2, '0', 180, 'default_3x3', 'catalog_limited_headline1', 'catalog_limited_teaser', '', 'Welcome to the VIP catalog. This are is exclusive for VIP members only. Selling rares is not against the rules but buying on request is. Anybody found doing so will have their vip subscription suspended', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(24, 3, 'Windows', 0, 63, '1', '1', 1, '0', 71, 'default_3x3', 'ctlg_windows_headline1_en', 'ctlg_windows_teaser1_en', 'catalog_special_txtbg2', 'Let some light in! Our windows come in many unique styles to give an exciting look to your room. Buy landscapes to go with your windows from the \'Spaces\' page!', '', 0, 'Click on an item for more information.', 'Ooh, new view!', '0', '', ''),
(26, 3, 'Moodlights', 0, 40, '1', '1', 1, '0', 40, 'default_3x3', 'catalog_dimmers_header_en', 'dimmers_teaser', '', 'Our range of moodlights allow you to control the atmosphere and transform your room in just a click. What will your room look like? Click the switch and find out now!', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(27, 3, 'Christmas', 1, 90, '1', '1', 1, '0', 14, 'default_3x3', 'catalog_xmas_headline1', 'xmas2009_catalogue', 'catalog_special_txtbg2', 'Get yourself into the Christmas spirit with our selection of festive furni! From baubles to Reindeer poo, we\'ve got it all!', '', 0, 'Click on an item for more information.', '\'tis the season!', '0', '', ''),
(28, 3, 'Arctic', 0, 13, '1', '1', 1, '0', 5, 'default_3x3', 'catalog_arc_header1_en', 'catalog_arc_teaser1_en', '', 'Stay cool (or warm with out campfire!) with and create your own Winter Wonderland or Humble Homeland for your Penguins.', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(29, 3, 'Teleporters', 0, 58, '1', '1', 1, '0', 62, 'default_3x3', 'catalog_doors_headline1', 'catalog_door_a', 'catalog_special_txtbg1', 'Take your room to a whole new level with our range of space age teleporters! Just buy a pair, put one in each room and voila! You\'ll have two linked rooms!', '', 0, 'Click on an item for more information.', 'Take your room to the next level!', '0', '', ''),
(30, 3, 'Mode', 0, 39, '1', '1', 1, '0', 39, 'default_3x3', 'catalog_mode_headline1', 'catalog_mode_teaser1', 'catalog_special_txtbg2', 'Steely, grey industrial standard metal with a sleek design. The perfect range for a streetwise city dweller.', '', 0, 'Click on an item for more information.', 'So shiny and new..', '0', '', ''),
(31, 3, 'Candy', 0, 19, '1', '1', 1, '0', 13, 'default_3x3', 'catalog_candy_headline1', 'catalog_candy_teaser1', 'catalog_special_txtbg2', 'A bit more feminine than \'Mode\', this will add a bit of glamour and glitz to your rooms. Lacking a few items? Head on over to the \'Mode\' catagory!', '', 0, 'Click on an item for more information.', 'lol I killed a pink bear for this rug!', '0', '', ''),
(32, 3, 'Pura', 0, 48, '1', '1', 1, '0', 49, 'default_3x3', 'catalog_pura_headline1', 'catalog_pura_teaser1', 'catalog_special_txtbg2', 'The clenest, freshest range. You can almost hear it breath cool and tranquility within your room. Use it to create a haven away from the hetic lifestyle of UberHotel.', '', 0, 'Click on an item for more information.', 'So many colors!', '0', '', ''),
(33, 3, 'Area', 0, 14, '1', '1', 1, '0', 6, 'default_3x3', 'catalog_area_headline1', 'catalog_area_teaser1', 'catalog_special_txtbg2', 'A chunky and sofisticated line for the down-to-earth, studious Uber. It\'s simplicty is beautful and will add a welcoming charm to every room.', '', 0, 'Click on an item for more information.', 'Beautiful in it\'s simplicity! ', '0', '', ''),
(34, 3, 'Country', 0, 21, '1', '1', 1, '0', 16, 'default_3x3', 'country_header1_en_001', 'country_teaser1', 'catalog_special_txtbg2', 'Lets leave the busy city streets and head over to the wide abyss of golden whear, emerald fields and home grown, organic vegetables. Everything you need to create a farm!', '', 0, 'Click on an item for more information.', 'Who\'d be a crow, eh?', '0', '', ''),
(35, 3, 'Lodge', 0, 37, '1', '1', 1, '0', 35, 'default_3x3', 'catalog_lodge_headline1', 'catalog_lodge_teaser1', 'catalog_special_txtbg2', 'For that splendid ski-lodge effect with an open fire and whisky on the sidebar. This range is for those who appreicate the true beauty of solid wood.', '', 0, 'Click on an item for more information.', 'I liek wood!', '0', '', ''),
(36, 3, 'Plastic', 0, 46, '1', '1', 1, '0', 47, 'plasto', 'catalog_plasto_headline1', '', '', 'Throw on an afro and grab a disco ball! Feel that retro, 1970s vibe? You soon will with this colourful, plastic range! Choose a colour to suit your mood and off you go!', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(38, 3, 'Bathroom', 0, 17, '1', '1', 1, '0', 8, 'default_3x3', 'catalog_bath_headline1', 'catalog_bath_teaser1', 'catalog_special_txtbg2', 'Lets face it.. you can\'t live without your bathroom. Give yours guests somewhere to freshen up with our cheeful bathroom collection!', '', 0, 'Click on an item for more information.', 'Every Uber needs one!', '0', '', ''),
(39, 3, 'Plants', 0, 45, '1', '1', 1, '0', 46, 'default_3x3', 'catalog_plants_headline1', 'catalog_plants_teaser1', 'catalog_special_txtbg2', 'Every room needs some greenery, dear! Not only do they enhance the air quality, they cheer up a room to make it simply splendid! And what better gift for a friend than an elegant rose..', '', 0, 'Click on an item for more information.', 'I\'m a tree!', '0', '', ''),
(40, 3, 'Rugs', 0, 52, '1', '1', 1, '0', 53, 'default_3x3', 'catalog_rugs_headline1', 'catalog_posters_teaser1', 'catalog_special_txtbg2', 'Rugs for all occasions, white for weddings, black for funerals and everything in between! All rugs and non-slip and machine washable. Take your pick!', '', 0, 'Click on an item for more information.', 'This\'ll be perfect in my room!', '0', '', ''),
(41, 3, 'Gallery', 0, 47, '1', '1', 1, '0', 23, 'default_3x3', 'catalog_gallery_headline1', 'catalog_posters_teaser1', 'catalog_special_txtbg2', 'Adorn your walls with posters, art, plaques and wall hangings. This gallery is bursting with items to suit all tastes, traditional and modern!', '', 0, 'Click on an item for more information.', 'Brighten up your walls!', '0', '', ''),
(42, 3, 'Trophies', 0, 60, '1', '1', 1, '0', 64, 'trophies', 'catalog_trophies_headline1', '', '', 'Everyones a winner with Habboon trophies! Now you can reward all your friends with our pre-polished array of trohpies. In bronze, silver and gold. \r\nFirst choose your trophy model, then the metal and carefully type your inscription. Don\'t worry, we\'ll engrave it all with your name and the date.', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(43, 3, 'Accessories', 0, 11, '1', '1', 1, '0', 1, 'default_3x3', 'catalog_extra_headline1', 'catalog_extra_teaser1', 'catalog_special_txtbg2', 'However you like to place your essentials, its the finishing touches that really make a room and express your true personality. Don\'t forget, like anything else, you can move them all about to suit your mood!', '', 0, 'Click on an item for more information.', 'I love my rabbit...', '0', '', ''),
(45, 4, 'Rentals', 0, 44, '0', '0', 1, '0', 3, 'default_3x3', 'catalog_pixelrent_headline1_en', 'catalog_pxl_teaser3_en', '', 'Hire some cool effects to add an explosive touch to your room. From bubbles to firestarters, you can enhance your room dramatically!', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(55, 3, 'Iced', 0, 13, '1', '1', 1, '0', 31, 'default_3x3', 'catalog_iced_headline1', 'catalog_iced_teaser1', '', 'The Iced range, squishy, soft and most definitely cool. Whatever your needs, this stylish range should  cover it!', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(56, 3, 'Alhambra', 0, 12, '1', '1', 1, '0', 3, 'default_3x3', 'catalog_alh_headline1_en', 'catalog_alh_teaser1_en', '', 'For the cold Arabian nights and hot Arabian days, you\'ll need a palace.. and we have just what you need! Green blossom print should cover it just fine!', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(57, 3, 'Asian', 0, 15, '1', '1', 1, '0', 7, 'default_3x3', 'catalog_asian_headline1', 'catalog_asian_teaser1', '', 'Ting tong! Ching chong? Ting chong ting, ping ping! I mean uh.. with our authentic Chinese furniture, you can make a beautiful oriental room!', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(58, 3, 'Bensalem', 0, 18, '1', '1', 1, '0', 10, 'default_3x3', 'catalog_lc_headline2_en', 'catalog_lc_teaser1_en_001', '', 'Under the seaaaaaaaaa, oh, Under the seaaaaaa! What will your underwater world look like? We have it all here, crabs, HIV and genital warts!', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(59, 3, 'Easter', 3, 25, '1', '1', 1, '0', 20, 'default_3x3', 'catalog_easter_headline1', 'catalog_easter_teaser1', '', 'Little birdies hatching from their eggs, pretty, dainty flowers blooming and cute rabbits bouncy in Spring meadows.. It\'s Easter!', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(60, 3, 'Executive', 0, 27, '1', '1', 1, '0', 21, 'default_3x3', 'catalog_exe_headline1_en', 'catalog_exe_teaser_en', '', 'For the ultimate business man, the Executive range with its leather seats and Italian coffee is a dream! How about you try the easy lifestyle?', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(61, 3, 'Glass', 0, 29, '1', '1', 1, '0', 24, 'default_3x3', 'catalog_glass_headline1', 'catalog_glass_teaser1', '', 'You can really open up a space with this stylish glass furniture, just don\'t walk into it!', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(62, 3, 'Gothic', 0, 30, '1', '1', 1, '0', 25, 'default_3x3', 'catalog_gothic_headline1', 'catalog_gothic_teaser1', '', 'As the church bells ring out midnight, you walk through your cobbled hall lit by candles, throw yourself into your medieval throne and paint your nails black. This is what we imagined when we ordered this range!', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(63, 3, 'Sports', 0, 56, '1', '1', 1, '0', 60, 'default_3x3', 'sports', 'catalog_sports_teaser1', '', 'Sport contains all those vital Olympic pieces from running tracks to basketball courts! 3 2 1 GO!', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(64, 3, 'Grunge', 0, 32, '1', '1', 1, '0', 27, 'default_3x3', 'catalog_grunge_headline1', 'catalog_gru_teaser_en', '', 'Sleeping rough? Make the streets a bit more bearable with our collection of homeless furni, Grunge!', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(65, 3, 'HabboWood', 0, 33, '1', '1', 1, '0', 28, 'default_3x3', 'habbowood', '', '', 'No flash photography, darling! This range is only for the VIP Hollywood actors!', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(66, 3, 'Halloween', 0, 34, '1', '1', 1, '0', 29, 'default_3x3', 'catalog_halloween_headline1', '', '', 'WooOOOOoooOOoo! Spooky! Don\'t wanna be left with this range at night.. who knows what would happen!', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(67, 3, 'Japan', 0, 36, '1', '1', 1, '0', 32, 'default_3x3', 'catalog_jap_headline2_en', 'catalog_jap_teaser3_en', '', 'We have sushi, tatami and katana\'s! I have no idea what the difference is, but I sure know its Japanese! Fulfil your fantasies and buy some today!', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(68, 3, 'Lost Tribe', 0, 38, '1', '1', 1, '0', 36, 'default_3x3', 'losttribe', 'LT_teaser_en', '', 'Start your own tribal village with our ancient furniture, all carved from hard wearing stone. NOTE: Lava is hot, get an adult to help you.', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(69, 3, 'Neon', 0, 41, '1', '1', 1, '0', 42, 'default_3x3', 'catalog_frontpage_headline2_en', 'catalog_neon_teaser1_en', '', 'New years eve, birthdays and every other day of the year, there\'s always an exscuse for a party! So, why don\'t you buy some Neon furni!?', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(71, 3, 'Relax', 0, 49, '1', '1', 1, '0', 50, 'default_3x3', 'rela_header_en', 'rela_teaser_en', '', 'Relax after a busy day in the Welcome Lounge. Light a few candles, and chill out with a good read in a wicker chair. We understand the needs of an Uber with a hectic lifestyle!', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(72, 3, 'Romantique', 0, 50, '1', '1', 1, '0', 52, 'default_3x3', 'catalog_romantique_headline1', 'catalog_rom_teaser_en', '', 'Found in a French barn, this sweet but sexily romantic range caters to every ladies needs. Just going to powder my nose!', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(73, 3, 'Science Fiction', 0, 53, '1', '1', 1, '0', 56, 'default_3x3', 'sf_header_en', 'sf_teaser_en', '', 'Blipblop blip blip blip.. Oooh.. what\'s this button do?.. You can find out exactly what it does with our new Scifi range, batteries included!', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(74, 3, 'Shalimar', 0, 54, '1', '1', 1, '0', 57, 'default_3x3', 'catalog_shal_header1_en', 'catalog_shal_teaser_en', '', 'Everyone loves Bollywood! Want some free credits? Tell Oscar you successfully read the Shalimar page! Tell no one else you found this Easter egg. Watch out for rose petals!', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(75, 3, 'Summer', 0, 57, '1', '1', 1, '0', 61, 'default_3x3', 'catalog_frontpage_headline2_en', 'catalog_sum_teaser1_en', '', 'Phwoar! Start up the barbie! This range has everything you need for the perfect summer garden!', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(76, 3, 'Love', 0, 62, '1', '1', 1, '0', 37, 'default_3x3', 'catalog_love_headline1', '', '', 'Love is in the air once again! Buy your sweetheart a rose or whisper sweet nothings in their ear on a love sofa. Can you feel it? <3', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(77, 3, 'Greek', 0, 31, '1', '1', 1, '0', 26, 'default_3x3', 'catalog_frontpage_headline2_en', '', '', 'Be transported back to ancient Greece with a couple of thousand pounds and British Airways. Until then, build your own panthenon with our realist Greek range!', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(85, 9006, 'Collectables', 0, 71, '1', '1', 6, '0', 12, 'default_3x3', 'catalog_pixeldeals_headline1_en', 'catalog_pxl_teaser2_en', '', 'The Pixel Collectables are the ultimate collectors items, requiring a mammoth 2000 pixels and credits to buy! If you collect all the pieces and manage to put them together in certain ways, you\'ll receive a special effect!', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(88, 3, 'Virus', 0, 42, '1', '1', 1, '0', 68, 'default_3x3', 'catalog_vir_header1_en', 'catalog_vir_teaser_en', '', 'All of Uber\'s emergency pandemic supplies are kept here! They need a bit of a clean after the exploding puss disease but.. they\'ll do fine!', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(93, 204, 'Trophies ', 1, 60, '1', '1', 6, '0', 350, 'trophies', 'catalog_trophies_headline1', '', '', 'This page contains special trophies available for staff to give as prizes. STAFF CAUGHT GIVING OUT THESE WITH NO REASON WILL BE DEMOTED.', '', 0, 'Click in this grey box and type your inscription *carefully* - it\'s permanent!', '', '0', '', ''),
(94, 204, 'Rares Classic', 1, 10, '1', '1', 6, '0', 320, 'default_3x3', 'catalog_rares_headline1', '', '', 'This page contains special rares available for staff. STAFF CAUGHT GIVING OUT THESE WITH NO REASON WILL BE DEMOTED.', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(95, 204, 'Promo ', 1, 11, '1', '1', 6, '0', 310, 'default_3x3', 'catalog_rares_headline1', '', '', 'This page contains special promotional items available for staff. STAFF CAUGHT GIVING OUT THESE WITH NO REASON WILL BE DEMOTED.', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(102, 3, 'Rollers', 0, 96, '1', '1', 1, '0', 51, 'default_3x3', 'catalog_roller_headline1', 'catalog_teaser_rollers_en', '', 'Zoooooooom, Zooooooooooooooooooooooooooom! Was it a plane? Was it a bird!? No, it was Roy on a roller! You can use rollers in games, events or even just to  move a queue along.', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(103, 3, 'Diner', 0, 51, '1', '1', 1, '0', 18, 'default_3x3', 'diner', 'catalog_diner_teaser_en', '', 'Originally from the 50\'s this furni has been refurbished and put right into the catalogue! Use this with the Kitchen range for ultimate diner experience!', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(105, 204, 'Rares Colour', 0, 69, '1', '1', 6, '0', 330, 'default_3x3', 'catalog_rares_headline1', '', '', 'On this page, we have some lovely rares for you! We\'ve kept a few behind for competition and event prizes!', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(112, 3, 'Dungeon', 0, 64, '1', '1', 1, '0', 19, 'default_3x3', 'catalog_frontpage_headline2_en', '', '', 'I\'ve never read the book, all I know is it has vampires playing basket ball and some heart throb called Edward Cullen, but the furni looks good!', '', 0, 'Click on an item for more information.', '', '0', '', ''),
