(123, 4, 'Hello', 0, 35, '1', '1', 1, '0', 2, 'default_3x3', 'catalog_hello_header1_en', 'catalog_hello_teaser1_en', '', 'Hello Furni is available with Pixels and is perfect if you are decorating your room for the very first time. The Furni is yours to keep and therefore cannot be traded.', '', 0, 'Click on an item for more information.', '', '0', '', ''),
