(141, 14, 'Pigs', 0, 67, '1', '1', 1, '0', 11, 'pets', 'catalog_pet_headline1', '', '', 'These little scamps were destined for the dining table until we struck a deal with a local farmer to rescue their cute pigtails! Adopt your little piglet today, all you need now is a name.', '', 0, 'Give a name:Pick a color:Pick a race:', '', '0', '', ''),
